import React, {Component} from 'react'

import Header from '../Headers/Header'
import Menu from '../Headers/Menu'

import FooterTop from '../Footer/FooterTop'
import Footer from '../Footer/Footer'

function Checkout() {
  
  return (
    
    <div>
    <Header />
    <Menu/>
      
    <FooterTop/>
    <Footer/>
      </div>
    
  );
}

export default Checkout;
